import React from 'react'
import Logo from '../assets/images/LOGO.png'
import styled from 'styled-components'

const StyledFooter = styled.div`
height: 250px;
width: fit-content;
background-color: black;
`

export default function Footer() {
  return (
    StyledFooter
  )
}
